void	reduce(t_listint **state_stack, t_list **ast_stack, int reduce_rule)
{
	t_rule			rule;
	int				nb_child;
	enum e_symbol	symbol;
	t_ast			*new;
	int				i = 0;

	reduce_rule -= 1;
	rule = g_rule_table[reduce_rule];
	nb_child = rule.nb_child;
	symbol = rule.symbol;
	printf("reduce by rule : %s\n", rules[reduce_rule]);
	new = new_ast(NULL, symbol);
	while (i < nb_child)
	{
		ft_lstint_pop(state_stack);
		new->child[i] = ft_lst_pop(ast_stack)->data;
		i++;
	}
	ft_simple_lst_add(ast_stack, ft_simple_lst_create(new));
}

